Returns [entity' upserts]. Upsert attributes that resolve to existing entities
   are removed from entity, rest are kept in entity for insertion. No validation is performed.

   upserts :: {:name  {"Ivan"  1}
               :email {"ivan@" 2}
               :alias {"abc"   3
                       "def"   4}}}

